import Navbar from "../components/navbar";

const Home = () => (
  <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
        </ul>
    <h1>Hello world</h1>
  </div>
);

export default Home;
